import React from "react";
import Question from "./Question";

function QuestionList(props)
{
	let questions = props.questions.map((q) => {
		return (
			<li key={ q.id }>
				<div>
					<Question q={ q }/>
				</div>
			</li>
		);
	});
	return (
		<div className="cardHolder">
			<ul>
			{ questions }
			</ul>
		</div>
	);
}

export default QuestionList;
